	&lt;p&gt;Samsung Galaxy S9 has a 3000mAh battery that supports wireless charging. The Galaxy S9 boasts a rear camera with a revolutionary dual-aperture design.The Samsung Galaxy S9 features a 64GB ROM for storage, and the internal storage capacity can be expanded up to 400GB via the microSD slot.&lt;/p&gt;
