	&lt;div class=&quot;columns medium-12&quot;&gt;
	&lt;p&gt;Samsung Galaxy S9 has a 3000mAh battery that supports wireless charging. The Galaxy S9 boasts a rear camera with a revolutionary dual-aperture design.The Samsung Galaxy S9 features a 64GB ROM for storage, and the internal storage capacity can be expanded up to 400GB via the microSD slot. This Samsung smartphone features a Samsung exynos 9810 Octa-Core processor and 4GB RAM that makes multitasking swift and fluid. The S9 has a 12MP rear camera with a dual-aperture design that adapts to the varying lighting conditions just like the human eye. It even includes an 8MP front camera with Intelligent Scan for easy unlocking of the phone even in the dark. The Galaxy S9 has a 5.8-inch Super AMOLED Infinity Display with a resolution of 2960 x 1440 pixels, a pixel density of 570ppi, and an aspect ratio of 18.5:9. The 3000mAh battery of the Galaxy S9 features adaptive fast charging, and it also supports WPC and PMA wireless charging. The S9 flaunts a polished aluminum frame in a gray finish with an IP68-certified body for water and dust resistance.&lt;/p&gt;
