	&lt;div class=&quot;mart-30 row&quot;&gt;
	&lt;h4&gt;Beautiful Photos in Any Light&lt;/h4&gt;

	&lt;div class=&quot;columns medium-12&quot;&gt;&lt;img alt=&quot;Samsung Galaxy S9&quot; class=&quot;lazy-loaded&quot; src=&quot;https://souqcms.s3.amazonaws.com/spring/images/2018/samsung/Galaxy-S9-Dual-Sim/2-Galaxy-S9-Dual-Sim-grey.jpg&quot; /&gt;&lt;/div&gt;

	&lt;div class=&quot;columns mart-10 medium-12 text-center&quot;&gt;
	&lt;p&gt;Take photos without thinking twice when you have the Samsung Galaxy S9. The 12MP rear camera features two f-stop modes and a category-defining dual aperture design that adapts to bright light and super dim light automatically, just like the human eye. With the f/1.5 aperture mode, you can capture your nighttime adventures with stunning clarity. The rear camera has multi-frame noise reduction, so every photo you click in the dark comes out clear and bright, without any fine-tuning. The Samsung Galaxy S9 boasts of a super slow-mo mode that records videos at 960 frames per second. Show off your cinematography skills by adding slow motion bursts to highlight epic moments. It even features motion detection, so it starts to record in slow-mo only when the sensor detects movement. That&amp;rsquo;s not all, the camera also has optical image stabilization, which ensures your photos are sharp even when you&amp;rsquo;re on a bumpy ride. The S9 also has an 8MP front camera that you can use to click stunning selfies.&lt;/p&gt;
	&lt;/div&gt;
	&lt;/div&gt;

	&lt;div class=&quot;mart-10 row&quot;&gt;
	&lt;h4&gt;Turn Selfies into Emojis&lt;/h4&gt;

	&lt;div class=&quot;columns mart-10 medium-12 text-center&quot;&gt;
	&lt;p&gt;Messaging comes alive on the Samsung Galaxy S9. It lets you create an animated version of yourself to show off the inner you. Then you can add a personal touch to your message with the emoji, which detects and mimics your movements. The AR emojis let you strut your personal style with customization options ranging from clothes to hairstyles. The animated AR emojis lets you put your emotion in motion. You can record videos with the emoji talking, singing, or whatever you feel like doing. Sometimes words can&amp;rsquo;t express your wide range of emotions. With the Samsung Galaxy S9, expressing your feelings on chat is not a problem as it features 18 AR emoji stickers. Add a human touch to messaging with your very own expressive emojis.&lt;/p&gt;
	&lt;/div&gt;
	&lt;/div&gt;

	&lt;div class=&quot;mart-10 row&quot;&gt;
	&lt;h4&gt;See More and Hold Less with Infinity Display&lt;/h4&gt;

	&lt;div class=&quot;columns medium-12&quot;&gt;&lt;img alt=&quot;Samsung Galaxy S9&quot; src=&quot;https://cf1.s3.souqcdn.com/static/ltr/en/images/lazy.png&quot; /&gt;&lt;/div&gt;

	&lt;div class=&quot;columns mart-10 medium-12 text-center&quot;&gt;
	&lt;p&gt;The Galaxy S9 opens up your view with its grand, edge-to-edge, 5.8-inch display. The S9 with its near bezel-less design fits comfortably in your hand despite its large size. It has curves on the sides that provide a sight that is boundless with minimal visual distractions of the bezel. The screen has an 18.5:9 aspect ratio that gives you a cinematic view. It features Advanced Contrast Enhancement that lets you view photos as they were meant to be seen.&lt;/p&gt;
	&lt;/div&gt;
	&lt;/div&gt;

	&lt;div class=&quot;mart-10 row&quot;&gt;
	&lt;h4&gt;Speed Is All That Matters&lt;/h4&gt;

	&lt;div class=&quot;columns medium-12&quot;&gt;&lt;img alt=&quot;Samsung Galaxy S9&quot; src=&quot;https://cf1.s3.souqcdn.com/static/ltr/en/images/lazy.png&quot; /&gt;&lt;/div&gt;

	&lt;div class=&quot;columns mart-10 medium-12 text-center&quot;&gt;
	&lt;p&gt;The Samsung Galaxy S9 features a Samsung exynos 9810 Octa-Core processor and 4GB RAM. It lets you switch apps and multitask in a snap. Get your game on, watch videos, or text while you stream videos; whatever you do, the S9 performs quickly and fluidly. Moreover, with LTE speeds up to 1.2Gbps, the Galaxy S9 lets you download swiftly and stream instantly.&lt;/p&gt;
	&lt;/div&gt;
	&lt;/div&gt;

	&lt;div class=&quot;mart-10 row&quot;&gt;
	&lt;h4&gt;Forget What It Is Like to Run Out of Space&lt;/h4&gt;

	&lt;div class=&quot;columns medium-12&quot;&gt;&lt;img alt=&quot;Samsung Galaxy S9&quot; src=&quot;https://cf1.s3.souqcdn.com/static/ltr/en/images/lazy.png&quot; /&gt;&lt;/div&gt;

	&lt;div class=&quot;columns mart-10 medium-12 text-center&quot;&gt;
	&lt;p&gt;The S9 has an incredible storage capacity of 128GB. It even includes an expandable microSD slot that supports cards up to 400GB. It also lets you store your photos on Google Photos with unlimited storage. Lack of space? What&amp;rsquo;s that? Is what you will say when you have the Galaxy S9 in your pocket.&lt;/p&gt;
