	&lt;h4&gt;See More and Hold Less with Infinity Display&lt;/h4&gt;

	&lt;div class=&quot;columns medium-12&quot;&gt;&lt;img alt=&quot;Samsung Galaxy S9&quot; src=&quot;https://cf1.s3.souqcdn.com/static/ltr/en/images/lazy.png&quot; /&gt;&lt;/div&gt;

	&lt;div class=&quot;columns mart-10 medium-12 text-center&quot;&gt;
	&lt;p&gt;The Galaxy S9 opens up your view with its grand, edge-to-edge, 5.8-inch display. The S9 with its near bezel-less design fits comfortably in your hand despite its large size. It has curves on the sides that provide a sight that is boundless with minimal visual distractions of the bezel. The screen has an 18.5:9 aspect ratio that gives you a cinematic view. It features Advanced Contrast Enhancement that lets you view photos as they were meant to be seen.&lt;/p&gt;
